import React from 'react';
import Navbar from './NavBar/Navbar';

export const App = () => {
  return (
    <div>
      <Navbar />
      <Routes>
        <Route path="/" element={<BlogView />} />
        <Route path="/create" element={<NewPostView />} />
        <Route path="/post/:id" element={<PostInfoView />} />
      </Routes>
    </div>
  );
};
